import React from 'react'
import { Container } from 'react-bootstrap';

function SearchBar() {
  return (
    <Container>
      <form action="../pages/SearchResult" method="POST">
      <input class="form-control" type="search" placeholder="Search" aria-label="Search" required/>
      <button class="btn btn-outline-success" name="search-logins" type="submit">Search</button>
      </form>
    </Container>
  );
};

export default SearchBar
